export default function Home({data}) {
    console.log(data)
    return (<Layout>
        <div className="container">
        <select className="form-control">
            <option value="USD">USD</option>
            <option value="GBP">GBP</option>
            <option value="EUR">EUR</option>
        </select>
        </div>
    </Layout>)
}

